import { BrowserRouter, Link } from "react-router-dom";
import React from "react";
import Wdata from "./WatchData";

const UrlParser = () => {
  return (
    <>
      {Wdata.map((user) => (
        <Link to={"/Product/" + user.id + "/" + user.title}>
          <p> {user.title} </p>
        </Link>
      ))}
    </>
  );
};

export default UrlParser;
